import React, { Component } from 'react';
import './App.css';
import './components/layout/Navbar';
import Navbar from './components/layout/Navbar';

class App extends Component {
  render() {
    const name = 'Daniel Andersson hej hej';
    const loading = false;

    return (
      <div className='App'>
        <Navbar />
        {loading ? <h4>Loading Data ...</h4> : <h1>Hello {name}</h1>}
      </div>
    );
  }
}
export default App;
